import SearchResultsItem from "./SearchResultsItem";

export default function SearchResults({ results, isSearching, lnoticias }) { 
    console.log(lnoticias.articles);
    console.log(results.main);
    return(
        <div style={{ 
            width: "100%",
            padding: "0rem 2rem 0rem 2rem"
        }}>
            {results.length < 1 && !isSearching ? <p>No existen resultados</p>
                :           
               <div>
                    <p>Nombre de la ciudad: {results.name}</p>
                    <p>Temperatura {results.main && results.main.humidity}</p>
                </div>
                }
        </div>
    );
}
